import Gmap from '../components/gmap'
import ResultList from '../components/resultlist'
import './mappage.css'

function MapPage(props) {


    return (
        <div id="wrapper">
            <div id="mainwrapper">
                <button></button>
                <Gmap userLoc={props.userLoc} ></Gmap>
                <ResultList></ResultList>
            </div>
        </div>
    )

}

export default MapPage;
